"use strict";(self.webpackChunkdirectdesignlab_github_io=self.webpackChunkdirectdesignlab_github_io||[]).push([[263],{263:i=>{i.exports=JSON.parse('[{"id":"1","title":"Sample Type-Thon Topic 1","images":[{"src":"/assets/svgs/2_tradition_modularity/ccheon2.svg","alt":"Description of image 1","style":"style1"}],"description":"\uc804\ud1b5\uc774\ub780, \ud2b9\uc815 \uc9d1\ub2e8\uc774\ub098 \uacf5\ub3d9\uccb4\uc5d0\uc11c \uacfc\uac70\uc5d0 \ud615\uc131\ub41c \uc0ac\uc0c1, \uad00\uc2b5, \ud589\ub3d9 \ub4f1\uc758 \uc591\uc2dd\uc774 \uacc4\ud1b5\uc744 \uc774\ub8e8\uba70 \uc804\ud574 \ub0b4\ub824\uc624\ub294 \uac83\uc744 \uc758\ubbf8\ud569\ub2c8\ub2e4. \uc804\ud1b5\uc774 \uc9d1\ub2e8 \uad6c\uc131\uc6d0\uc758 \uc815\uccb4\uc131\uc744 \ub098\ud0c0\ub0b4\ub294 \uc810\uc774 \ub9c8\uce58 \ub3d9\ubb3c\uc758 \ud2b9\uc9d5\uc744 \ud488\uc740 \uc54c\uacfc \ub2ee\uc558\ub2e4\uace0 \uc0dd\uac01\ud558\uc5ec, \uc804\ud1b5 \ubd80\ud65c\uc808 \ub2ec\uac40\uc758 \uc870\ud615\uc801 \uc774\ubbf8\uc9c0\ub97c \ucc28\uc6a9\ud574 \uc11c\uccb4\ub97c \ub514\uc790\uc778\ud588\uc2b5\ub2c8\ub2e4. \ucee8\uc149\uc5d0 \ub530\ub77c \uc54c\uacfc \ubd80\ud65c\uc808 \ub2ec\uac40 \ubb34\ub2ac\uc758 \uc870\ud615\uc801 \ud2b9\uc9d5\uc744 \ubc14\ud0d5\uc73c\ub85c \uba3c\uc800 \uc2ec\ubcfc\uc744 \uc81c\uc791\ud588\uc2b5\ub2c8\ub2e4. \uc774\ud6c4 \uc774 \uc2ec\ubcfc\uc744 \ubaa8\ub4c8\ub85c \ud65c\uc6a9\ud574 \uc11c\uccb4\uc5d0 \uc790\uc5f0\uc2a4\ub7fd\uac8c \uc2a4\uba70\ub4e4\ub3c4\ub85d \ub514\uc790\uc778\ud588\uc2b5\ub2c8\ub2e4. \ub610\ud55c \uc2ec\ubcfc\uc744 \ubaa8\ub4c8\ud654\ud558\uba74\uc11c\ub3c4 \ub531\ub531\ud55c \uc0ac\uac01\ud615 \uc870\ud615 \uc18d\uc5d0 \ub2f4\uc544 \uc804\ud1b5\uc758 \uaddc\ubc94\uc801 \uc774\ubbf8\uc9c0\ub97c \ud45c\ud604\ud558\ub824 \ud588\uc2b5\ub2c8\ub2e4. \uc774\uc5d0 \ub530\ub77c \uc7a5\uc2dd\uc801\uc778 \uc694\uc18c\ub97c \ucd5c\uc18c\ud654\ud574, \uc804\ud1b5\uc758 \uc5c4\uaca9\ud568\uacfc \uc790\uc720\ub85c\uc6b4 \ub290\ub08c\uc774 \ub300\ube44\ub418\ub3c4\ub85d \ud588\uc2b5\ub2c8\ub2e4."},{"id":"2","title":"Sample Type-Thon Topic 2","images":[{"src":"/assets/svgs/2_tradition_modularity/dyoung2.svg","alt":"Description of image 2","style":"style1"}],"description":"\uc804\ud1b5\uc740 \ubb38\ud654, \uc591\uc2dd, \ubbfc\uc871\uc131 \ub4f1 \ub2e4\uc591\ud55c \uc694\uc18c\ub85c \uc774\ub8e8\uc5b4\uc838 \uc788\uc2b5\ub2c8\ub2e4. \uc800\ub294 \uadf8 \uc911\uc5d0\uc11c \uc6b0\ub9ac\ub098\ub77c\uc758 \uc804\ud1b5\ubb34\ub2ac\uc778 \ub3c4\uae68\ube44 \uc5bc\uad74 \ubaa8\uc591\uc778 \u2018\uadc0\ubb38\u2019\uc744 \ubc14\ud0d5\uc73c\ub85c \uc11c\uccb4\ub97c \ub514\uc790\uc778\ud588\uc2b5\ub2c8\ub2e4. \uae00\uc790\ub9c8\ub2e4 \uc0c1, \uc911, \ud558\ub97c \uad6c\ubd84\ud558\uc5ec, \uc0c1\ub2e8\uc740 \uba38\ub9ac \uc717\ubd80\ubd84, \uc911\ub2e8\uc740 \ub208 \ubd80\ubd84, \ud558\ub2e8\uc740 \ud131 \ubd80\ubd84\uc744 \ud45c\ud604\ud574 \ud55c \ub2e8\uc5b4\uc5d0 \ud558\ub098\uc758 \uc5bc\uad74\uc774 \ub098\ud0c0\ub098\ub3c4\ub85d \ud588\uc2b5\ub2c8\ub2e4. \ub208\uacfc \uc774\ube68\uc744 \ucd94\uac00\ud560 \ub54c\ub294 \ud310\ub3c5\uc131\uc744 \uace0\ub824\ud574 \uc6d0\ub798 \uae00\uc790\uc758 \ud615\ud0dc\ub97c \ud574\uce58\uc9c0 \uc54a\ub3c4\ub85d \uc2e0\uacbd\uc37c\uc2b5\ub2c8\ub2e4. \ud558\uc9c0\ub9cc \ubc1b\uce68\uc774 \uc5c6\ub294 \uae00\uc790\uc758 \uacbd\uc6b0 \ud131 \ubd80\ubd84\uc758 \ubaa8\uc591\uc774\ub098 \uc704\uce58\uac00 \uc560\ub9e4\ud574 \ud45c\ud604\ud558\uae30 \uc5b4\ub824\uc6b4 \uc810\uc774 \uc788\uc5c8\uc2b5\ub2c8\ub2e4."},{"id":"3","title":"Sample Type-Thon Topic 3","images":[{"src":"/assets/svgs/2_tradition_modularity/hisang2.svg","alt":"Description of image 1","style":"style1"}],"description":"\uc804\ud1b5\uc774\ub77c\ub294 \uac1c\ub150\uc744 \uc911\uc2ec\uc73c\ub85c, \uc774 \uc8fc\uc81c\uc5d0 \ub300\ud55c \uc811\uadfc\uc744 \uc2dc\uc791\ud588\uc2b5\ub2c8\ub2e4. \uc804\ud1b5\uc740 \uc138\ub300\uc640 \uc9d1\ub2e8\uc744 \uac70\uce58\uba70 \uc804\uc2b9\ub418\ub294 \uacfc\uc815\uc5d0\uc11c \ub0b4\ub824\uc624\ub294 \uac83\uc774\ub77c\ub294 \ud558\uac15\uc758 \uc774\ubbf8\uc9c0\uc640 \uc5f0\uacb0\ub429\ub2c8\ub2e4. \uc774\ub7ec\ud55c \ud558\uac15\uc740 \uace0\uc815\ub41c \uc2dc\uc791\uc810\uc5d0\uc11c \uc2dc\uc791\ud558\uc5ec, \uc2dc\uac04\uc744 \ub530\ub77c \uacc4\uc2b9\ud558\ub294 \uc0ac\ub78c\ub4e4\uc5d0 \uc758\ud574 \ubcc0\ud615\ub418\uace0 \uc804\ud574\uc9d1\ub2c8\ub2e4. \uc774\ub97c \uc2dc\uac01\uc801\uc73c\ub85c \ud45c\ud604\ud558\uae30 \uc704\ud574, \uc138\ub85c\ud68d\uc740 \uac01\uc774 \ub69c\ub837\ud558\uace0 \uc9c1\uc120\uc801\uc778 \uc774\ubbf8\uc9c0\ub85c \ucd9c\ubc1c\ud558\uba70 \ub3d9\uc77c\ud55c \uc2dc\uc791\uc810\uc5d0\uc11c \uc810\ucc28 \uace1\ub960\uc774 \uc99d\uac00\ud558\ub294 \ud615\ud0dc\ub85c \ud558\uac15\ud569\ub2c8\ub2e4. \uc544\ub798\ub85c \ub0b4\ub824\uac08\uc218\ub85d \uace1\ub960\uc740 \uc911\ub825\uc744 \ub530\ub77c \ub5a8\uc5b4\uc9c0\ub294 \ub4ef\ud55c \ud750\ub984\uc744 \ubcf4\uc5ec\uc90d\ub2c8\ub2e4. \uac00\ub85c\ud68d\uc740 \ud558\uac15\uc758 \uc774\ubbf8\uc9c0\ub97c \uac15\uc870\ud558\uae30 \uc704\ud574 \uc815\uc801\uc778 \ud615\ud0dc\ub97c \uc720\uc9c0\ud558\ub418, \ud558\uac15 \ud3ed\uc758 \uc810\uc9c4\uc801 \ubcc0\ud654\ub97c \ud1b5\ud574 \uc218\uc9c1\uc801 \uc18d\ub3c4\uac10\uc744 \ud45c\ud604\ud558\ub3c4\ub85d \uc124\uacc4\ud588\uc2b5\ub2c8\ub2e4. \uc774\ucc98\ub7fc \ubcf8\uc9c8\uacfc \uc5f0\uacb0\ub418\uc5b4 \uc788\uc73c\ub098 \uc138\ub300\ub97c \uac70\uce58\uba70 \uc870\uae08\uc529 \ubcc0\ud654\ud558\ub294 \uc804\ud1b5\uc758 \ud2b9\uc131\uc744 \ud558\uac15\uc758 \uc774\ubbf8\uc9c0\ub85c \uac15\uc870\ud574, \ud55c\uae00 \uc11c\uccb4\uc5d0 \ucd94\uc0c1\uc801\uc778 \uac1c\ub150\uc744 \uad6c\uccb4\ud654\ud558\uc5ec \ub514\uc790\uc778\ud588\uc2b5\ub2c8\ub2e4."},{"id":"4","title":"Sample Type-Thon Topic 4","images":[{"src":"/assets/svgs/2_tradition_modularity/hjung2.svg","alt":"Description of image 1","style":"style1"}],"description":"\ud48d\ubb3c \uc74c\uc545\uc5d0\uc11c \uc601\uac10\uc744 \ubc1b\uc544 \ub514\uc790\uc778\uc744 \uc9c4\ud589\ud588\uc2b5\ub2c8\ub2e4. \ud48d\ubb3c\uc758 \uc8fc\uc694 \uad6c\uc131 \uc694\uc18c\uc778 \uc0c1\ubaa8\uc758 \uc720\ub824\ud55c \uc120\uc758 \uc6c0\uc9c1\uc784\uc5d0 \uc8fc\ubaa9\ud558\uba70, \ud48d\ubb3c\ud328 \uacf5\uc5f0\uc5d0\uc11c \uc790\uc8fc \ubcf4\uc774\ub294 \uc6d0\uacfc \uc120\uc758 \ub3d9\uc801\uc778 \uc6c0\uc9c1\uc784\uc744 \ubc14\ud0d5\uc73c\ub85c \ub514\uc790\uc778\uc758 \uae30\ubcf8 \ubaa8\ub4c8\uc744 \uc6d0\uacfc \uace1\uc120\uc73c\ub85c \uc124\uc815\ud588\uc2b5\ub2c8\ub2e4. \uc0ac\ub78c\uc774 \ubaa8\uc5ec \uc810\uc774 \ub418\uace0, \uc810\ub4e4\uc774 \uc120\uc774 \ub418\uace0, \uc120\ub4e4\uc774 \ubaa8\uc5ec \uba74\uc744 \uc774\ub8ec\ub2e4\ub294 \uacfc\uc815\uc744 \ud45c\ud604\ud558\uace0\uc790 \ud588\uc2b5\ub2c8\ub2e4. \uadf8\ub798\uc11c \uc6d0\uc5d0\uc11c \uc2dc\uc791\ud574 \uc120\uc774 \ub098\ud0c0\ub098\uace0, \uc810\uacfc \uc120\ub4e4\uc774 \ubaa8\uc5ec \uba74\uc744 \ud615\uc131\ud574 \uae00\uc790\ub97c \ub9cc\ub4e4\uc5b4\uac00\ub294 \uad6c\uc870\uc5d0 \uc9d1\uc911\ud588\uc2b5\ub2c8\ub2e4. \ud558\uc9c0\ub9cc \uac01 \uad6c\uc131 \uc694\uc18c\uc5d0 \uc9d1\uc911\ud558\ub2e4 \ubcf4\ub2c8, \uc774\ub4e4 \uc694\uc18c\ub4e4\uc774 \uacb0\ud569\ub418\ub294 \ubc29\uc2dd\uc5d0 \ub300\ud55c \uad6c\uccb4\uc801\uc778 \uae30\uc900\uc744 \ud655\ub9bd\ud558\uc9c0 \ubabb\ud55c \uc810\uc774 \uc544\uc27d\ub2e4. \uc870\ud569\uc5d0 \uc77c\uad00\uc131\uc774 \ubd80\uc871\ud558\uace0 \ud559\uad50\uc5d0\uc11c \ubc30\uc6b4 \ud0c0\uc774\ud3ec\uadf8\ub798\ud53c \uc774\ub860\uc744 \ucda9\ubd84\ud788 \ud65c\uc6a9\ud558\uc9c0 \ubabb\ud55c \uc810\ub3c4 \uc544\uc26c\uc6b4 \ubd80\ubd84\uc785\ub2c8\ub2e4. \uc774\ub97c \uac1c\uc120\ud558\ub824\uba74, \uae00\uc790\uc758 \ube44\uc728\uacfc \uadf8\ub9ac\ub4dc \uc0ac\uc6a9\uc744 \ub354 \uace0\ubbfc\ud558\uace0 \uba85\ud655\ud55c \uacb0\uc815\uc744 \ub0b4\ub824\uc57c \ud560 \uac83\uc785\ub2c8\ub2e4."},{"id":"5","title":"Sample Type-Thon Topic 5","images":[{"src":"/assets/svgs/2_tradition_modularity/ian2.svg","alt":"Description of image 1","style":"style1"}],"description":"\uc804\ud1b5\uc774\ub77c\ub294 \uc8fc\uc81c\uc5d0\uc11c \ub2ec\ud56d\uc544\ub9ac\uc758 \uc544\ub984\ub2e4\uc6c0\uc744 \ub5a0\uc62c\ub838\uc2b5\ub2c8\ub2e4. \ub2ec\ud56d\uc544\ub9ac\ub294 \uc21c\ubc31\uc0c9\uc758 \ub2e8\uc21c\ud55c \ud615\ud0dc\uc9c0\ub9cc, \uac01\uac01\uc758 \ubaa8\uc591\uc774 \ub2e4\ub974\uace0 \uadf8 \uace1\uc120\uc774 \uc720\ub824\ud558\uc5ec \uacc4\uc18d \ubc14\ub77c\ubcf4\uac8c \ub418\ub294 \ub9e4\ub825\uc774 \uc788\ub2e4\uace0 \uc0dd\uac01\ud588\uc2b5\ub2c8\ub2e4. \ub514\uc790\uc778\uc744 \ud560 \ub54c\ub294 \ub2ec\ud56d\uc544\ub9ac\uc758 \uc2e4\ub8e8\uc5e3\uc5d0\uc11c \ubaa8\ub4c8 \ud615\ud0dc\ub97c \ucc28\uc6a9\ud558\uc600\uace0, \uae00\uc790\ub97c \ub9cc\ub4e4 \ub54c\ub294 \ub465\uadfc \ud615\ud0dc\ub97c \uac15\uc870\ud558\uae30 \uc704\ud574 \ud68d\uc744 \uad75\uac8c \ud558\uc5ec \uae00\uc790\uac00 \ucc28\uc9c0\ud558\ub294 \uc601\uc5ed\uc744 \ub113\ud614\uc2b5\ub2c8\ub2e4. \ub610\ud55c, \ubd80\ub9ac\ub97c \ube44\uc815\ud615\uc801\uc73c\ub85c \ub465\uae00\uac8c \ub9cc\ub4e4\uc5b4 \uc190\uc73c\ub85c \ube5a\uc740 \ub2ec\ud56d\uc544\ub9ac\uc758 \uc870\ud615\uc801 \ud2b9\uc131\uc744 \ubc18\uc601\ud558\uace0\uc790 \ud588\uc2b5\ub2c8\ub2e4. \uc804\ubc18\uc801\uc73c\ub85c \ub2ec\ud56d\uc544\ub9ac\ub97c \ub514\uc790\uc778 \uc694\uc18c\ub85c \uc0ac\uc6a9\ud55c \uac83\uc774 \ud765\ubbf8\ub85c\uc6b4 \uc2dc\ub3c4\uc600\uc73c\uba70, \ub2e4\uc74c\uc5d0\ub294 \uadf8 \ubcf8\uc9c8\uc801\uc778 \ub9e4\ub825\uc744 \ub354\uc6b1 \uac15\uc870\ud558\ub294 \ub514\uc790\uc778\uc744 \uc2dc\ub3c4\ud574\ubcf4\uace0 \uc2f6\uc2b5\ub2c8\ub2e4."},{"id":"6","title":"Sample Type-Thon Topic 6","images":[{"src":"/assets/svgs/2_tradition_modularity/sungju2.svg","alt":"Description of image 1","style":"style1"}],"description":"\uc804\ud1b5\uc740 \ud754\uc801\uc774\ub2e4. \uc774 \ud504\ub85c\uc81d\ud2b8\ub97c \uc2dc\uc791\ud560 \ub54c, \uae00\uc790\uaf34 \ub514\uc790\uc778\uc740 \uc804\ud1b5\uc758 \uac1c\ub150\uc5d0 \ub300\ud574 \uc0dd\uac01\ud558\ub294 \uac83\uc5d0\uc11c\ubd80\ud130 \uc2dc\uc791\ub418\uc5c8\ub2e4. \uc6b0\ub9ac\uac00 \ud604\ub300\uc5d0 \uc785\ub294 \uc637\uc5d0 \ub2f4\uae34 \uc5ec\ub7ec \uc694\uc18c\ub4e4\uc774 \uacfc\uac70\uc5d0\ub294 \uc2e4\uc6a9\uc801 \ubaa9\uc801\uc774\uc5c8\uc9c0\ub9cc, \uc2dc\uac04\uc774 \uc9c0\ub098\uba74\uc11c \ud754\uc801\uc73c\ub85c \ub0a8\uac8c \ub418\ub294 \uacbd\uc6b0\uac00 \ub9ce\ub2e4. \uc774\ub7f0 \ud604\uc0c1\uc744 \uae00\uc790\uaf34\ub85c \ud45c\ud604\ud558\uace0\uc790 \ud588\ub2e4. \uc804\ud1b5\uc801\uc778 \uae00\uc790\uaf34 \uc911 \uad81\uc11c\uccb4\ub97c \ub5a0\uc62c\ub9ac\uba70 \uadf8 \ud2b9\uc9d5\ub4e4\uc744 \uc798\ub77c \ubaa8\ub4c8\ud654\ud558\uc5ec, \uadf8 \ubaa8\ub4c8\ub4e4\uc744 \uc870\ud569\ud574 \uc81c3\uc758 \uae00\uc790\uaf34\uc744 \uc124\uacc4\ud588\ub2e4. \uadf8 \uacfc\uc815\uc5d0\uc11c \uac00\uc7a5 \uc911\uc694\ud55c \uc810\uc740 \ubd93\uae00\uc528\ub97c \ubc14\ud0d5\uc73c\ub85c \ub9cc\ub4e4\uc5b4\uc9c4 \uad81\uc11c\uccb4\uc5d0\uc11c \ubcf4\uc774\ub294 \ud2b9\uc9d5\ub4e4\uc744 \uc798 \uc0b4\ub9ac\ub418, \uad81\uc11c\uccb4\uc640\ub294 \ub2e4\ub978 \ub3c5\ud2b9\ud55c \ub290\ub08c\uc744 \uc8fc\ub294 \uac83\uc774\uc5c8\ub2e4. \uad81\uc11c\uccb4\uc758 \ud2b9\uc9d5\ub4e4\uc774 \uc7ac\uc870\ud569\ub418\ub294 \uacfc\uc815\uc5d0\uc11c \uc810\ucc28 \ud574\uccb4\ub418\uc5c8\uace0, \ub9c8\uce58 \uccad\ubc14\uc9c0\uc5d0 \uc6a9\ub3c4\ub97c \uc54c \uc218 \uc5c6\ub294 \uc8fc\uba38\ub2c8\uac00 \ub2ec\ub824 \uc788\ub294 \ub4ef\ud55c \uc778\uc0c1\uc744 \uc8fc\ub294 \ud615\ud0dc\ub85c \ubcc0\ud615\ub418\uc5c8\ub2e4."},{"id":"7","title":"Sample Type-Thon Topic 6","images":[{"src":"/assets/svgs/2_tradition_modularity/yewon2.svg","alt":"Description of image 1","style":"style1"}],"description":"\ud55c\uad6d \uc804\ud1b5\uac00\uc625\uc758 \ubb38\uc5d0\uc11c \ubcfc \uc218 \uc788\ub294 \ucc3d\ud638 \ubb34\ub2ac\ub97c \ubaa8\ud2f0\ud504\ub85c \ud55c \ud55c\uae00 \ub808\ud130\ub9c1\uc744 \ub514\uc790\uc778\ud588\uc2b5\ub2c8\ub2e4. \ucc3d\ud638\ub294 \ud55c\uad6d \uac00\uc625\uc5d0\uc11c \ucc3d\uacfc \uc9c0\uac8c\ubb38\uc744 \ubaa8\ub450 \uc758\ubbf8\ud558\uba70, \uc218\uc9c1\uacfc \uc218\ud3c9\uc758 \uaca9\uc790\ubb34\ub2ac\uc640 45\ub3c4 \uac01\ub3c4\uc758 \uac70\ubd81\uc774 \uc794\ub4f1\ubb34\ub2ac\uac00 \ud2b9\uc9d5\uc785\ub2c8\ub2e4. \uc774\ub7ec\ud55c \uc694\uc18c\ub4e4\uc744 \uc870\ud615\uc801\uc73c\ub85c \uac00\uc838\uc640, \uc218\uc9c1, \uc218\ud3c9, 45\ub3c4 \uac01\ub3c4 \ub4f1 \uc81c\ud55c\uc801\uc778 \uac01\ub3c4\ub85c \uc774\ub8e8\uc5b4\uc9c4 \ubaa8\ub4c8\uc744 \uc0ac\uc6a9\ud574 \ub514\uc790\uc778\uc744 \uc644\uc131\ud588\uc2b5\ub2c8\ub2e4. \ub610\ud55c, \uc77c\uc815\ud55c \ub450\uaed8\uc758 \ucc3d\uc0b4\uc744 \ubc18\ubcf5\ud558\uc5ec \ud45c\ud604\ud558\uae30 \uc704\ud574, \uc587\uc740 \ud68d\uc758 \ub450\uaed8\ub97c \uc77c\uad00\ub418\uac8c \ub9de\ucdc4\uc2b5\ub2c8\ub2e4. \uc774 \ucc3d\ud638 \uc11c\uccb4\ub97c \ud65c\uc6a9\ud574 \ud558\ub098\uc758 \uc11c\uccb4 \ud328\ubc00\ub9ac\ub97c \uad6c\uc131\ud558\ub294 \uac83\ub3c4 \ud765\ubbf8\ub85c\uc6b4 \uc2dc\ub3c4\uc77c \uac83\uc785\ub2c8\ub2e4. \ucc3d\ud638\ubb38\ucc98\ub7fc \ud55c\uc9c0\ub97c \ub367\ub300\uc5b4 \uc0ac\uc6a9\ud558\ub294 \ubc29\uc2dd\ucc98\ub7fc, \uaca9\uc790\ubb34\ub2ac\uc640 \uac19\uc740 \ud68d\uc744 \ub367\ubd99\uc5ec \ub354 \ud654\ub824\ud558\uace0 \ubcfc\ub4dc\ud55c \uc11c\uccb4\ub85c \ubcc0\ud615\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc774\ub97c \ud1b5\ud574 \ub514\uc790\uc778\uc5d0\uc11c \uace0\ubbfc\ud588\ub358, \ucc3d\ud638\uc9c0\uc758 \ud2b9\uc9d5\uc774 \uc9c1\uad00\uc801\uc73c\ub85c \ub4dc\ub7ec\ub098\uc9c0 \uc54a\ub294 \ubb38\uc81c\ub3c4 \ud574\uacb0\ud560 \uc218 \uc788\uc744 \uac83\uc785\ub2c8\ub2e4."},{"id":"8","title":"Sample Type-Thon Topic 6","images":[{"src":"/assets/svgs/2_tradition_modularity/yujin2.svg","alt":"Description of image 1","style":"style1"}],"description":"\ud0dc\uadf9\uae30 \uc18d \ubcf5\ud76c\ud314\uad18 \uc911 \uac74, \uace4, \uac10, \ub9ac\uc5d0\uc11c \ubaa8\ud2f0\ube0c\ub97c \uc5bb\uc5b4 \ud3f0\ud2b8\ub97c \ub514\uc790\uc778\ud588\uc2b5\ub2c8\ub2e4. \uc804\ud1b5\uc744 \uc8fc\uc81c\ub85c \u2018\ud55c\uad6d\u2019\uc744 \uc0c1\uc9d5\ud558\ub294 \ub300\ud45c\uc801\uc778 \ubb38\uc591\uc744 \ud65c\uc6a9\ud558\uace0\uc790 \ud588\uc73c\uba70, \uc870\uc120 \uc2dc\ub300\ubd80\ud130 \uc0ac\uc6a9\ub41c \ud0dc\uadf9\uae30 \uc18d \uad18\ub4e4\uc744 \uc791\uc5c5\uc758 \uae30\ubc18\uc73c\ub85c \uc0bc\uc558\uc2b5\ub2c8\ub2e4. \ud3f0\ud2b8 \ub514\uc790\uc778 \uacfc\uc815\uc5d0\uc11c\ub294 \uac74\uace4\uac10\ub9ac \uad18\uc758 \ube44\uc728\uacfc \ud68d \uac04 \uac04\uaca9\uc744 \uad18\uc640 \uc77c\uce58\uc2dc\ud0a4\ub294 \ub370 \uc911\uc810\uc744 \ub450\uc5c8\uc73c\uba70, \ub300\uac01\uc120 \ud68d\uc740 \ud0dc\uadf9\uae30 \uad18\uc758 \uc2e4\uc81c \uac01\ub3c4\ub97c \uc815\ud655\ud788 \ubc18\uc601\ud558\ub824 \ub178\ub825\ud588\uc2b5\ub2c8\ub2e4. \ucd08\uae30 \uc2a4\ucf00\uce58\ub294 \uc138\ub85c\ub85c \uc774\uc5b4\ubd99\uc778 \uc138 \uac1c\uc758 \uad18 \ube44\uc728\uc5d0\uc11c \uc2dc\uc791\ud588\uace0, \ucd5c\uc885 \uacb0\uacfc\ubb3c \uc5ed\uc2dc \u2018\uc804\ud1b5\u2019\uc774\ub77c\ub294 \uae00\uc790\ub97c \ud45c\ud604\ud558\uba74\uc11c\ub3c4 \uc138\ub85c\ub85c \uc774\uc5b4\uc9c4 \uad18\ub85c \ubcf4\uc774\ub3c4\ub85d \uc124\uacc4\ud588\uc2b5\ub2c8\ub2e4. \ud2b9\ud788 \u2018\uc804\u2019 \uae00\uc790\uc758 \ud45c\ud604 \ubc29\uc2dd\uc5d0 \ub9ce\uc740 \uace0\ubbfc\uc744 \ub2f4\uc558\uc2b5\ub2c8\ub2e4. \uc55e\uc73c\ub85c\ub294 \ud314\uad18\ub97c \ub118\uc5b4 64\uad18\uc758 \ub2e4\uc591\ud55c \ubc30\uc5f4\uc744 \ucc38\uace0\ud558\uc5ec, \ub354\uc6b1 \uc870\ud615\uc801\uc73c\ub85c \ubc1c\uc804\ub41c \ub514\uc790\uc778\uc744 \ubaa8\uc0c9\ud560 \uacc4\ud68d\uc785\ub2c8\ub2e4."},{"id":"9","title":"Sample Type-Thon Topic 6","images":[{"src":"/assets/svgs/2_tradition_modularity/yunoo2.svg","alt":"Description of image 1","style":"style1"}],"description":"\ud55c\uad6d \uc804\ud1b5 \ubb38\uc591\uc778 \uad6c\ub984\ubb38\uc5d0\uc11c \uc601\uac10\uc744 \ubc1b\uc544 \uc11c\uccb4\ub97c \ub514\uc790\uc778\ud588\uc2b5\ub2c8\ub2e4. \ub465\uae00\uace0 \ub0a0\ub835\ud55c \ud615\ud0dc\uac00 \ubc18\ubcf5\ub418\ub294 \ud504\ub808\uc784\uc744 \uae30\ubc18\uc73c\ub85c \uc11c\uccb4\uc758 \uc678\uacfd\uc744 \uc815\ub3c8\ud558\uace0, \ub0b4\ubd80 \ud68d\uc740 \ucc3d\uc0b4\ucc98\ub7fc \uc218\uc9c1\uacfc \uc218\ud3c9\uc73c\ub85c \uad50\ucc28\uc2dc\ucf1c \uc548\uc815\uac10\uacfc \uae30\ud558\ud559\uc801 \uc544\ub984\ub2e4\uc6c0\uc744 \ub354\ud588\uc2b5\ub2c8\ub2e4. \uc720\uc5f0\ud55c \ud14c\ub450\ub9ac\uc640 \ub0b4\ubd80 \ubaa8\ub4c8\uc740 \uc804\ud1b5\uc801 \uac10\uac01\uacfc \uc138\ub828\ubbf8\ub97c \ub3d9\uc2dc\uc5d0 \ub2f4\uace0\uc790 \ud588\uc2b5\ub2c8\ub2e4. \ud544\uc555 \uc5c6\uc774 \ub2e8\ub2e8\ud558\uace0 \uc815\ub3c8\ub41c \ud68d\uc744 \ud1b5\ud574 \uc815\uac08\ud568\uacfc \ud654\ub824\ud568\uc744 \ud45c\ud604\ud558\ub824 \ud588\uc2b5\ub2c8\ub2e4. \uc774\ubc88 \uc791\uc5c5\uc5d0\uc11c\ub294 \uc758\ub3c4\uc801\uc73c\ub85c \ud68d\uc758 \uad75\uae30\ub97c \uade0\uc77c\ud558\uac8c \uc720\uc9c0\ud574 \uade0\ud615\uc744 \uac15\uc870\ud588\uc9c0\ub9cc, \uc774\ud6c4 \uc791\uc5c5\uc5d0\uc11c\ub294 \uc11c\uccb4\uc758 \uac00\ub3c5\uc131\uacfc \uc644\uc131\ub3c4\ub97c \ub192\uc774\uae30 \uc704\ud574 \ud14c\ub450\ub9ac\uc640 \ud68d\uc758 \uad75\uae30\ub97c \uc870\uc815\ud558\uace0, \ud68d \uac04\uaca9\uacfc \ud615\ud0dc\ub97c \ubcc0\ud654\uc2dc\ucf1c \ub354 \uac00\ubcbc\uc6b4 \ud615\ud0dc\ub85c \ub2e4\uc591\ud55c \ud45c\ud604\uc744 \uc2dc\ub3c4\ud560 \uc608\uc815\uc785\ub2c8\ub2e4."},{"id":"10","title":"Sample Type-Thon Topic 6","images":[{"src":"/assets/svgs/2_tradition_modularity/yesung2.svg","alt":"Description of image 1","style":"style1"}],"description":"\uc704 \uc11c\uccb4\ub294 \uc804\ud1b5 \ud55c\uc625\uc758 \uae30\uc640\ub97c \ubaa8\ud2f0\ube0c\ub85c \uc81c\uc791\ub418\uc5c8\uc2b5\ub2c8\ub2e4. \uae30\uc640\ub97c \uc313\uc744 \ub54c \ud55c \uc7a5 \ud55c \uc7a5 \uc815\uad50\ud558\uac8c \ub9de\ubb3c\ub9ac\ub294 \uac74\ucd95 \ubc29\uc2dd\uc5d0\uc11c \uc601\uac10\uc744 \ubc1b\uc544, \uc11c\uccb4\uc5d0 \uc0ac\uc6a9\ub41c \uace1\uc120\ub4e4\uc774 \uc790\uc5f0\uc2a4\ub7fd\uac8c \uc911\ucca9\ub418\uba70 \uc5b4\uc6b0\ub7ec\uc9c0\ub294 \uad6c\uc870\ub97c \uad6c\ud604\ud588\uc2b5\ub2c8\ub2e4. \ub610\ud55c, \uae30\uc640 \uc9c0\ubd95 \uc81c\uc791\uc5d0 \ud65c\uc6a9\ub418\ub294 \uc0ac\uc774\ud074\ub85c\uc774\ub4dc \uace1\uc120\uc73c\ub85c \uc6d0\ud615 \uadf8\ub9ac\ub4dc\ub97c \ub9cc\ub4e4\uc5b4 \ucd94\ucd9c\ud55c \ud615\ud0dc\uc18c\ub97c \ubc14\ud0d5\uc73c\ub85c \uc791\uc5c5\uc744 \uc9c4\ud589\ud568\uc73c\ub85c\uc368 \uae30\uc640\uc758 \uace1\uc120\uc801\uc778 \uc544\ub984\ub2e4\uc6c0\uc744 \uc11c\uccb4 \ub514\uc790\uc778 \uc804\ubc18\uc5d0 \ubc18\uc601\ud558\uace0\uc790 \ud588\uc2b5\ub2c8\ub2e4."}]')}}]);